def solution(n, k, id_list):
    conversations = []
    for id in id_list:
        if id not in conversations:
            if len(conversations) >= k:
                conversations.pop()
            conversations = [id] + conversations
    return len(conversations), conversations

if __name__ == '__main__':
    n, k = list(map(int, input().split()))
    id_list = list(map(int, input().split()))
    m, conversations = solution(n, k, id_list)
    print(m)
    print(*conversations)

def main():
    n, k = [int(x) for x in input().split()]
    messages = [int(x) for x in input().split()]
    messages.reverse()
    conversations = []
    for message in messages:
        if message not in conversations:
            if len(conversations) == k:
                conversations.pop()
            conversations.insert(0, message)
    print(len(conversations))
    print(' '.join([str(x) for x in conversations]))

main()
